import React, { FC } from "react";
import Link from "next/link";
import { Search } from "../icon";

const SearchButton: FC = () => (
  <Link href="/search">
    <a>
      <Search style={{ fill: "#4142DD" }} />
    </a>
  </Link>
);

export default SearchButton;
